//        arrayOfString[0] = "\u793f\ubc2a\u6178\u163e\u797c\ubc67\u613c\u162a\ubc6d\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u6172\u1630\u796a\ubc29\u6173\u1638\u796f\ubc74\u617a\u1636\u7974\ubc75\u616a\u163c\u7978\ubc28\u617a\u1631\u7936\ubc2c\u6170\u163d\u797c\ubc35\u6136\u1666\u796a\ubc67\u613c\u162a\u793f\ubc35\u6124\u162b\u797c\ubc39\u617c\u1637\u796d\ubc7c\u6169\u1638\u797e\ubc3f\u6124\u167c\u796a\ubc7a\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u6172\u1630\u796a\ubc29\u6173\u1638\u796f\ubc74\u617a\u1636\u7974\ubc75\u616f\u1630\u797d\ubc3f\u6176\u162a\u7936\ubc7f\u616a\u1676\u793c\ubc29\ubc4e\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u6172\u1630\u796a\ubc29\u6173\u1638\u796f\ubc74\u617a\u1636\u7974\ubc75\ubc77\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u6172\u1630\u796a\ubc29\u6173\u1638\u796f\ubc74\u617a\u1636\u7974\ubc75\u617a\u1638\u796d\ubc3f\u617e\u1636\u796b\ubc33\u617c\u162a\u7936\ubc65\u6176\u162b\u797d\ubc3f\u616b\u1664\u7969\ubc35\u6169\u162c\u7975\ubc3b\u616b\ubc49\u6137\u163a\u7978\ubc2e\u617c\u163e\u7976\ubc28\u6160\u1674\u796d\ubc33\u616d\u1635\u797c\ubc7a\u6127\u1679\u7978\ubc5e\u6171\u162b\u797c\ubc3c\ubc5b\u6136\ubc5f\u616d\u1630\u796d\ubc36\u617c\ubc5e\u6137\u1634\u7969\ubc6e\ubc5e\u6137\u1634\u792a\ubc2f\ubc5c\u616d\u1636\u797d\ubc3b\u6160\u1676\ubc5f\u616e\u163c\u797c\ubc31\u6136\ubc5c\u6174\u1636\u7977\ubc2e\u6171\u1676\ubc5f\u6160\u163c\u7978\ubc28\u6136\ubc5a\ubc5d\u616f\u1630\u797c\ubc2d\u617c\u163d\u7936\ubc50\u617d\u1630\u796a\ubc39\u616c\u162a\u796a\ubc3f\u617d\u1676\ubc5c\u616b\u1638\u796d\ubc3f\u617d\u1676\ubc50\u617f\u1638\u796f\ubc35\u616b\u1630\u796d\ubc3f\u617d\u1676\ubc51\u617d\u1636\u796e\ubc34\u6175\u1636\u7978\ubc3e\u617c\u163d\u7936\ubc52\u616e\u1638\u796d\ubc39\u6171\u163c\u797d\ubc75\ubc5a\ubc4e\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u6172\u1630\u796a\ubc29\u6173\u1638\u796f\ubc74\u617a\u1636\u7974\ubc75\ubc40\u6160\u1620\u7960\ubc23\u6134\u1614\u7954\ubc77\u617d\u163d\u793e\ubc0e\u613e\u1611\u7951\ubc60\u6174\u1634\u7923\ubc29\u616a\u1603\u7943\ubc00\u6143\u1603\ubc5c\u616a\u163a\u796b\ubc33\u6169\u162d\ubc5b\u613e\ubc50\u6175\u1636\u7978\ubc3e\u6146\u162f\u7970\ubc3e\u617c\u1636\ubc5c\u614a\u163a\u796b\ubc33\u6169\u162d\ubc50\u614c\u162a\u797c\ubc28\u6134\u1618\u797e\ubc3f\u6177\u162d\ubcdd\u6154\u1636\u7963\ubc33\u6175\u1635\u7978\ubc75\u612c\u1677\u7929\ubc7a\u6131\u1630\u7949\ubc32\u6176\u1637\u797c\ubc61\u6139\u161a\u7949\ubc0f\u6139\u1630\u7949\ubc32\u6176\u1637\u797c\ubc7a\u6156\u160a\u7939\ubc6b\u612b\u1606\u792b\ubc7a\u6175\u1630\u7972\ubc3f\u6139\u1614\u7978\ubc39\u6139\u1616\u794a\ubc7a\u6141\u1670\u7939\ubc1b\u6169\u1629\u7975\ubc3f\u614e\u163c\u797b\ubc11\u6170\u162d\u7936\ubc6c\u6129\u166c\u7937\ubc6b\u6137\u1668\u792c\ubc7a\u6131\u1612\u7951\ubc0e\u6154\u1615\u7935\ubc7a\u6175\u1630\u7972\ubc3f\u6139\u161e\u797c\ubc39\u6172\u1636\u7930\ubc7a\u614f\u163c\u796b\ubc29\u6170\u1636\u7977\ubc75\u6128\u166b\u7937\ubc6b\u6139\u1614\u7976\ubc38\u6170\u1635\u797c\ubc75\u6128\u166c\u795c\ubc6b\u612d\u1661\u7939\ubc09\u6178\u163f\u7978\ubc28\u6170\u1676\u792f\ubc6a\u612d\u1677\u7928\ubc5d\u614b\u163c\u797f\ubc3f\u616b\u163c\u796b\ubc5c\u6156\u162b\u7970\ubc3d\u6170\u1637\ubc52\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\ubc7d\u613a\u163a\u7976\ubc34\u616d\u163c\u7977\ubc2e\u6146\u163a\u7976\ubc34\u616d\u1638\u7970\ubc34\u617c\u162b\u7939\ubc74\u616f\u1630\u797d\ubc3f\u6176\u1606\u797b\ubc36\u6176\u163a\u7972\ubc05\u616e\u162b\u7978\ubc2a\u6169\u163c\u796b\ubc51\u6137\u162f\u7970\ubc3e\u617c\u1636\u7946\ubc36\u6170\u1637\u7972\ubc5e\u6171\u162b\u797c\ubc3c\ubc56\u6137\u162f\u7970\ubc3e\u617c\u1636\u7946\ubc2e\u6170\u162d\u7975\ubc3f\ubc53\u6137\u163d\u796c\ubc28\u6178\u162d\u7970\ubc35\u6177\ubc56\u6137\u162f\u7970\ubc3e\u617c\u1636\u7946\ubc39\u6176\u162c\u7977\ubc2e\ubc5b\u6139\ubc5b\u6135\ubc5a\ubc4b\u6137\u162f\u7970\ubc3e\u617c\u1636\u7946\ubc2a\u617c\u162b\u797a\ubc3f\u6177\u162d\u7978\ubc3d\u617c\ubc5b\u613c\ubc5a\ubc55\u6137\u1630\u7974\ubc3d\u6146\u162f\u7970\ubc3e\u617c\u1636\u7946\ubc36\u6170\u162a\u796d\ubc52\u617d\u1638\u796d\ubc3b\u6134\u162a\u796b\ubc39\ubc52\u614b\u160d\u7939\ubc0e\u6171\u162c\u7974\ubc38\ubc73\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u616e\u162e\u796e\ubc74\u616b\u163c\u797d\ubc2e\u616c\u163b\u797c\ubc74\u617a\u1636\u7974\ubc75\u616b\u163c\u797a\ubc35\u6174\u1634\u797c\ubc34\u617d\u163c\u797d\ubc65\u6169\u1638\u797e\ubc3f\u6124\ubc42\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u616e\u162e\u796e\ubc74\u616b\u163c\u797d\ubc2e\u616c\u163b\u797c\ubc74\u617a\u1636\u7974\ubc75\ubc52\u6126\u1629\u797c\ubc28\u6170\u1636\u797d\ubc67\ubc5c\u613f\u1629\u7978\ubc3d\u617c\u1664\ubc7a\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u616e\u162e\u796e\ubc74\u616b\u163c\u797d\ubc2e\u616c\u163b\u797c\ubc74\u617a\u1636\u7974\ubc75\u6126\u162a\u797c\ubc3b\u616b\u163a\u7971\ubc67\ubc5c\u613f\u1629\u7978\ubc3d\u617c\u1664\ubc7a\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u616e\u162e\u796e\ubc74\u616b\u163c\u797d\ubc2e\u616c\u163b\u797c\ubc74\u617a\u1636\u7974\ubc75\u616b\u163c\u797d\ubc2e\u616c\u163b\u797c\ubc75\ubc5c\u6126\u1629\u7978\ubc3d\u617c\u1664\ubc42\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u616e\u162e\u796e\ubc74\u616b\u163c\u797d\ubc2e\u616c\u163b\u797c\ubc74\u617a\u1636\u7974\ubc75\ubc78\u6171\u162d\u796d\ubc2a\u616a\u1663\u7936\ubc75\u616e\u162e\u796e\ubc74\u616b\u163c\u797d\ubc2e\u616c\u163b\u797c\ubc74\u617a\u1636\u7974\ubc75\u617a\u1638\u796d\ubc3f\u617e\u1636\u796b\ubc33\u617c\u162a\ubc4e\u6137\u163a\u7978\ubc2e\u617c\u163e\u7976\ubc28\u6160\u1606\u796d\ubc32\u616c\u1634\u797b\ubc05\u6175\u1630\u7977\ubc31\ubc59\u614e\u160d\u795f\ubc5e\u6171\u162b\u797c\ubc3c\ubc5e\u6171\u162b\u797c\ubc3c\ubc5b\u6136\ubc59\u6178\u1635\u796d\ubc5c\u616a\u163a\u796b\ubc33\u6169\u162d\ubc5b\u613b\ubc5e\u6137\u1634\u7969\ubc6e\ubc5e\u6171\u162d\u796d\ubc2a\ubc58\u6145\u1676\ubc5b\u6136\ubc5b\u6146\ubc5b\u6172\ubc5a\ubc43\u6137\u162f\u7970\ubc3e\u617c\u1636\u7934\ubc33\u6177